import React from 'react';
import styled from 'styled-components'

const background = styled.div`
    display: flex;
    position: fixed;
    background-color: #ACBCD2;
    height: 200px;
    width: 100px;
    z-index: 5;
`

function ToolBar() {
    return(
        <>
        <background>
            Navbar
        </background>
        </>
    )
}

export default ToolBar;
